import groovy.sql.Sql;
//Establish JDBC Connection to the DB
def conString = context.expand( '${#Project#ConString}' )
def  con = Sql.newInstance(conString, "com.microsoft.sqlserver.jdbc.SQLServerDriver");
//get the vendorid from response
def response_VendorID = context.expand( '${Properties#mkVendorID}' )
log.info(response_VendorID)
def res = con.rows("select mkvendorid,vendorname from mkvendor where mkvendorid="+response_VendorID)
log.info(res[0][0])
log.info(res[0][1])
con.close()
testRunner.testCase.setPropertyValue( "DB_vendorid" ,res[0][0].toString())
testRunner.testCase.setPropertyValue( "DB_vendorname" ,res[0][1].toString())

